import React from 'react';
import { Nav, Navbar, Button, NavDropdown, Col, Container } from 'react-bootstrap';
import styled from 'styled-components';
import './NavigationBar.css';



export const NavigationBar = () => (
    <div>
        <nav class="nav justify-content-between align-items-center bg-primary flex-nowrap">
            <ul class="nav-item d-flex flex-row justify-content-start pl-0 ml-5 mb-0">
                <a class="nav-link active" href="#">HOME</a>
                <a class="nav-link" href="#">POSTS</a>
                <a class="nav-link" href="#">ABOUT</a>
                <a class="nav-link" href="#">CONTACT</a>
            </ul>
            <h2 class="nav-item mr-5 my-3" id="brand">FORWARD MUSING</h2>
            <div class="nav-item mx-5 d-none d-lg-flex">
                <button class="btn btn-dark ">Get Involved</button>
            </div>

        </nav>

    </div>

)
